INSERT INTO `music_comment` VALUES (3,1,NULL,NULL,1,'里面乱乱糟糟\n我们别再闹了\n这个冬天已然很冷了\n我们靠在一起。好吗','2019-01-06 16:12:13',54,30,'0'),(5,1,21,NULL,NULL,'允儿牵动我的心!!!','2019-01-06 18:12:53',3,2,'0'),(9,1,22,NULL,NULL,'林允儿这个人，饭她真的很骄傲。韩国人说汉语总会带着地 域性极强的泡菜味，可是林允儿真的很用心在把准每一个汉字，从咬字到发音，再加上轻柔干净的嗓音加持，将柔美与舒缓表达到极致，将歌里想诉说的那种感情娓娓道来。','2019-01-06 19:36:01',0,1,'1'),(10,1,21,NULL,NULL,'像我们之间一段长久未诉的告白，被你这样娓娓道来，你问我爱你有多深，我爱你有几分，我的情不移我的爱不变，月亮代表我的心。','2019-01-06 19:44:37',4,0,'1'),(11,1,21,NULL,NULL,'当听这首歌曲的时候，看看天上的月亮。美爆了！','2019-01-06 19:45:51',8,0,'1'),(12,1,23,NULL,NULL,'太尼马好听了！堂堂正正的林歌手！！','2019-01-06 19:48:25',0,0,'0'),(13,1,23,NULL,NULL,'林允儿啊，真的唱的很标准，很动人，我的同学都没想到是林允儿唱的，呜呜呜，爱死你了林允儿','2019-01-06 19:54:01',0,0,'0'),(14,1,22,NULL,NULL,'真的好棒，我只听她这个版本的','2019-01-06 19:55:43',0,0,'0'),(16,1,5,NULL,NULL,'好听啊','2019-01-06 19:56:52',0,0,'0'),(17,1,22,NULL,NULL,'我的允宝啊，努力演戏想让我们看到一样的你，努力学中文唱给我们听越来越爱你了','2019-01-06 19:58:53',0,0,'1'),(18,1,22,NULL,NULL,'好听啊','2019-01-06 20:01:46',0,0,'1'),(19,1,23,NULL,NULL,'好听啊','2019-01-06 20:03:59',0,0,'0'),(20,1,21,NULL,NULL,'好听啊','2019-01-06 20:04:22',0,0,'1'),(23,1,NULL,NULL,5,'赞！！','2019-01-08 01:05:27',2,0,'1'),(24,5,NULL,NULL,1,'超喜欢！','2019-01-08 21:46:29',7,0,'0'),(25,5,NULL,NULL,5,'大爱我林！','2019-01-08 21:47:45',1,0,'0'),(26,5,NULL,NULL,2,'nice','2019-01-08 22:11:23',1,0,'0'),(27,1,NULL,NULL,0,'很有感觉','2019-01-08 22:32:51',2,0,'0'),(28,5,26,NULL,NULL,'好听','2019-01-08 22:42:07',0,0,'0'),(29,5,21,NULL,NULL,'nice!','2019-01-08 22:57:08',0,0,'0'),(30,5,15,NULL,NULL,'好听！','2019-01-08 23:03:43',0,0,'0'),(31,1,13,NULL,NULL,'rrrr','2019-01-15 16:28:03',0,0,'0'),(32,1,19,NULL,NULL,'赞','2019-03-07 16:34:12',0,0,'0'),(33,1,6,NULL,NULL,'赞','2019-03-12 09:06:21',0,0,'0'),(34,1,NULL,NULL,1,'hao','2019-03-16 21:07:01',3,0,'0'),(35,1,NULL,NULL,38,'hao','2019-03-24 01:39:06',0,0,'0'),(36,1,NULL,NULL,0,'妙！','2019-03-24 01:48:56',1,0,'0'),(37,1,NULL,NULL,80,'好听','2019-03-24 01:51:02',0,0,'0'),(38,1,NULL,NULL,80,'好听！！！','2019-03-24 01:52:20',0,0,'0'),(39,1,NULL,NULL,80,'好听','2019-03-24