INSERT INTO `music_singer` VALUES (1,'张杰','1','singerPic|zhangjie.jpg','1982-12-20','中国四川','华语歌坛新生代领军人物，偶像与实力兼具的超人气天王。2004年出道至今，已发行9张高品质唱片，唱片销量称冠内地群雄。2008年以来举办过9场爆满的个人演唱会，在各大权威音乐奖项中先后21次获得“最受欢迎男歌手”称号，2012年度中国TOP排行榜内地最佳男歌手，2010年在 韩国M-net亚洲音乐大赏(MAMA)上获得“亚洲之星”（Best Asian Artist）大奖，影响力触及海外。'),(2,'周杰伦','1','singerPic|zhoujielun.jpg','1979-01-08 00:00:00','中国台 湾','著名歌手，音乐人，词曲创作人，编曲及制作人，MV及电影导演。新世纪华语歌坛领军人物，中国风歌曲始祖，被时代周刊誉为“ 亚洲猫王”，是2000年后亚洲流行乐坛最具革命性与指标性的创作歌手，亚洲销量超过3100万张，有“亚洲流行天王”之称，开启华语乐坛“R&B时代”与“流行乐中国风”的先河，周杰伦的出现打破了亚洲流行乐坛长年停滞不前的局面，为亚洲流行乐坛翻开了新的一页，是华语乐坛真正把R&B提升到主流高度的人物，引领华语乐坛革命整十年，改写了华语乐坛的流行方向。'),(3,'林允儿','0','singerPic|linyuner.jpg','1990-05-30 00:00:00','韩国','1990年5月30日出生于韩国首尔永登浦区，韩国女歌手、演员、主持人，女子演唱团体少女时代成员之一。2002年，林允儿参加韩国SM娱乐有限公司的选秀而进入SM公司成为旗下练习生。2007年8月5日，以演唱团体少女时代成员身份正式出道。2008年主演情感剧《你是我的命运》获得第45届韩国百想艺术大赏电视剧类最佳新人女演员奖和人气女演员奖。2009年主演励志爱情剧《乞丐变王子》...'),(4,'陈奕迅','1','singerPic|chenyixun.jpg','1974-07-27 00:00:00','中国香港','著名实力派粤语流行音乐歌手、演员，香港演艺人协会副会长之一，曾被美国《时代杂志》形容为影响香港乐坛风格的人物，同时也是继许冠杰、张学友之后第三个获得“歌神”称号的香港男歌手。同时他也是继张学友后另一个在台湾获得成功的香港歌手，在2003年他成为了第二个拿到台湾金曲奖“最佳国语男演唱人”的香港歌手。陈奕迅曾被《时代》杂志形容为影响香港乐坛风格的人物。2010年，陈奕迅入选全球华人音乐殿堂华语金曲奖“30年经典评选”，成为1990年代出道歌手唯一代表。'),(5,'G.E.M.邓紫棋','0','singerPic|dengziqi.jpg','1991-08-16','中国上海','成长于一个音乐世家，其母亲为上海音乐学院声乐系毕业生，外婆教唱歌，舅父拉小提琴，外公在乐团吹色士风。在家人的熏陶下，自小便热爱音乐，喜爱唱歌，与音乐结下不解之缘。G.E.M.在5岁的时候已经开始尝试作曲及填词，13岁完成了8级钢琴。G.E.M.在小学时期就读位于太子道西的中华基督教会协和小学上午校，为2003年的毕业生，同时亦为校内诗歌班成员。其英文名G.E.M.是Get Everybody Moving的缩写，象徵著她希望透过音乐让大家动起来的梦想。'),(6,'梁耀燮','1','singerPic|liangyaoxie.jpg','1990-01-05 00:00:00','韩国','Yang Yo Seop，1990年01月05日出生于韩国首尔，韩国歌手、演员、主持人，男子组合BEAST成员。 2009年10月16日以BEAST团员身份 出道，发行首张迷你专辑《Beast Is The B2ST》。2010年11月23日发行首张日语专辑《BEAST-Japan Premium Edition》。2012年11月26日推出首张个人Solo迷你专辑《The First Collage》，凭主打歌《咖啡因》获得KBS音乐银行一位、Mnet M! Countdown 一位。'),(7,'艺声','1','singerPic|yisheng.jpg','1984-08-24 00:00:00','韩国','韩国著名男子团体Super Junior成员之一。2001年参加Starlight Casting System Casting，获得SM BEST选拔大赛歌唱赛第一名。经过长达5年的练习生训练，于2005年11月6日以Super Junior的身份正式出道。有着“艺术般声音”的他，被冠以“艺声”这个名号，是队中公认唱功 最好的成员之一，因深沉、富有磁性且感情丰富的嗓音而在队里担当主唱。曾表演音乐剧、为多部电视剧演唱OST。值得一提的是，他也 是朱一丹女士的疯狂追求者之一。'),(8,'Ennio Morricone','1','singerPic|Morricone.jpg','1928-11-10 00:00:00','意大利','埃尼欧·莫里科内，意大利作曲家，生于罗马，曾为超过500部的电影电视写过配乐。2007年他获得奥斯卡终身成就奖，成为 第二位获此殊荣的作曲家。他获得两次格莱美奖，两次金球奖，五次英国电影和电视艺术学院奖等多项音乐奖项。'),(9,'林俊杰','1','singerPic|linjunjie.jpg','1981-03-27 00:00:00','新加坡','著名男歌手，作曲人、作词人、音乐制作人，偶像与实力兼具。林俊杰出生于新加坡的一个音乐世家。在父母的引导下，4岁就开始学 习古典钢琴，不善言辞的他由此发现了另一种与人沟通的语言。小时候的林俊杰把哥哥林俊峰当作偶像，跟随哥哥的步伐做任何事，直到接触流行音乐后，便爱上创作这一条路。2003年以专辑《乐行者》出道，2004年一曲《江南》红遍两岸三地，凭借其健康的形象，迷人的声线，出众的唱功，卓越的才华，迅速成为华语流行乐坛的领军人物之一，迄今为止共创作数百首音乐作品，唱片销量在全亚洲逾1000万张。'),(10,'王力宏','1','singerPic|wanglihong.jpg','1976-05-17 14:00:30','美国','中国著名流行歌手、词曲创作音乐人；亚洲华语流行乐坛最具代表性的创作、偶像、实力派音乐偶像巨星。1995年发行首张专辑《情敌贝多芬》在台湾出道，亦是金曲奖中最年轻的封王者，其唱片总销量在全亚洲已超过2500万张。从改编歌曲《龙的传人》融合西方电子节奏和东方旋律的华人中式嘻哈风，再到为华语流行乐注入新元素，进一步将其推向全世界。超高唱片销量便可以证明力宏的影响力毋庸置疑的强。况且身为金曲奖常客，3次接受CNN电视台访问。首创Chinked-out曲风，将中国风推向世界。'),(11,'Eminem','1','singerPic|Eminem.jpg','1972-10-17 15:35:23','美国','埃米纳姆（Eminem）是美国的一名说唱歌手。其风格类型为：Hardcore Rap（硬核说唱）。埃米纳姆最大的突破就是证明白人也能介入到黑人一统天下的说唱（RAP）界中，而且获得巨大的成功。同时他的叛逆不仅长期以来深受美国青少年喜爱，也让他在舆论中始终遭到抨击 。Eminem获得的奖杯总数窜至历史第三位，居麦当娜和皮特-加布里埃尔之后。'),(12,'李荣浩','1','singerPic|lironghao.jpg','1985-07-11 21:52:23','中国安 徽','李荣浩，1985年7月11日生于蚌埠，中国流行音乐制作人、歌手、吉他手。曾为众多艺人创作歌曲以及担任制作人，也曾为多部电 影与多款电子游戏制作音乐。2013年9月17日发行个人首张原创专辑《模特》，凭借这张专辑入围第25届金曲奖最佳国语男歌手奖、最佳 新人奖、最佳专辑制作人、最佳国语专辑、最佳作词奖等五项大奖提名，成为最大黑马，实现了从制作人到歌手的华丽转身。'),(13,'田馥甄','0','singerPic|tianfuzhen.jpg','1983-03-30 21:55:44','中国台湾','艺名Hebe，台湾知名女艺人，女子演唱团体S.H.E组合成员，出生于台湾新竹县新丰乡，于2000年参加“宇宙2000实力美少女争霸战”选秀活动，并于同年与宇宙唱片（华研唱片前身）签约培训，接着在隔年与Selina、Ella组成S.H.E，并于2001年9月11日发行S.H.E首张专辑《女生宿舍》正式出道。2010年下半年，S.H.E正式迈向“单飞不解散”阶段，接着同年9月3日，使用本名“田馥甄”推出首张个人专辑 《To Hebe》'),(14,'许嵩','1','singerPic|xusong.jpg','1986-05-14 21:58:45','中国安徽','著名作词人、作曲人、唱片制作人、歌手。内地独立音乐之标杆人物，有音乐鬼才之称。2009年独立出版首张词曲全创作专辑《自定义》，2010年独立出版第二张词曲全创作专辑《寻雾启示》，两度掀起讨论热潮，一跃成为内地互联网讨论度最高的独立音乐人。2011年加盟海蝶音乐，推出第三张词曲全创作专辑《苏格拉没有底》，发行首月即在大陆地区摘下唱片销量榜冠军，轰动全国媒体，并拉开全国巡回签售及歌迷见面会。'),(15,'张国荣','1','singerPic|zhangguorong.jpg','1956-09-12 22:02:38','中国香港','张国荣是一位在全球华人社会和亚洲地区具有影响力的著名歌手、演员和音乐人；大中华区乐坛和影坛巨星；演艺圈多栖发展最成功的代表之一。张国荣是香港乐坛的殿堂级歌手之一，曾获得香港乐坛最高荣誉金针奖；他是第一位享誉韩国乐坛的华人歌手，亦是华语唱片在韩国销量纪录保持者。他通晓词曲创作，曾担任过MTV导演、唱片监制、电影编剧、电影监制。他于1991年当选香港电影金像奖 影帝。。。'),(16,'杨宗纬','1','singerPic|yangzongwei.jpg','1978-04-04 22:04:47','中国 台湾','大学时期参加台湾歌唱选秀节目《超级星光大道》获选为第一届“人气王”。比赛的时候，杨宗纬歌声阳刚而细腻，富含感情，辨识度高，感染力强，以演唱抒情歌曲见长，选曲跨越性别界线，无论是男女歌手的抒情歌曲，经过他重新诠释之后，常常都可以得到不输原唱或甚至超越原唱的评价。出道后屡创多项记录，包括发行首张专辑，便以新人之姿登上台北小巨蛋举办个人演唱会。。。'),(17,'朴树','1','singerPic|pushu.jpg','1973-11-08 22:07:08','中国江苏',' 中国大陆歌手，音乐人。1996年10月正式成为“麦田音乐”签约歌手，为简略笔划而定艺名朴树。首支单曲《火车开往冬天》，96年底推出后成绩斐然。99年1月，推出首张个人专辑《我去两千年》。99年12月与华纳唱片正式签订唱片合约，成为其亚太区旗下的第一位内地歌 手，其首张专辑《我去两千年》将由华纳重新混录和拍摄最新单曲录影带后，于2000年上半年在海外隆重上市。代表作品：《那些花儿》，《白桦林》，《生如夏花》。主要成就：中歌榜最佳新人奖，最受欢迎男歌手，年度最佳制作人奖。'),(18,'李克勤','1','singerPic|likeqin.jpg','1967-12-06 22:10:04','中国香港','中国香港很有影响力的粤语流行曲歌手与演员。1985年凭《雾之恋》夺得“十九区业余歌唱大赛”冠军而晋身乐坛。曾于2002、2003和2005年度《十大劲歌金曲颁奖典礼》中三度夺得「最受欢迎男歌手」，于2003年度《叱吒乐坛流行榜颁奖典礼》上获得「叱吒乐坛我最喜 爱的男歌手」，并于《第二十七届十大中文金曲颁奖典礼》(2004年度)上夺得「最优秀流行男歌手大奖」，2010年度音乐先锋榜颁奖礼 ── 20家电台联颁亚太歌手奖。'),(19,'张碧晨','0','singerPic|zhangbichen.jpg','1989-09-10 22:15:16','中国 天津','1989年9月10日出生于中国天津，中国女歌手。 2013年，张碧晨以韩国女子组合“Sunny days ”出道，并获得“K-POP ”世界庆典“最优秀奖”。2014年7月，张碧晨参加第三季《中国好声音》，以一首《她说》进入那英组，并于10月7日以一首《时间去哪儿了》荣获第 三季《中国好声音》全国总冠军，成为《中国好声音》首位女冠军。'),(20,'IU','0','singerPic|IU.jpg','1993-05-16 00:00:00','韩国','李知恩 (IU)，1993年5月16日出生于韩国首尔特别市，韩国女歌手、演员、主持人。2008年以一首《迷儿》正式出道，历经一年的练习生生涯。2011年以一首《好日子》在韩国走红，随后于2011年末推出正规二辑《Last Fantasy》 PK记录74次，AK约90次。2013年IU发行正规三辑《MODERN TIMES》再次获得关注。2012年~2015年分别位列韩国福布斯名人榜第三、第八、第十和第十四位。2015年，发行迷你专辑《CHAT-SHIRE》'),(21,'金泰妍','0','singerPic|taiyan.jpg','1989-03-09 00:33:15','韩国','金泰妍(김태연/ Kim Tae-yeon/金泰耎)，艺名太妍(태연/TaeYeon)，1989年3月9日出生于韩国全罗北道全州市，韩国女歌手、主持人，女 子演唱团体少女时代成员之一。2004年在第八届SM青少年选拔大赛歌王中夺得第一名，进入韩国SM娱乐有限公司开始练习生生涯。2007年8月以演唱团体少女时代成员身份正式出道。2008年为韩国KBS电视台电视剧《快刀洪吉童》演唱主题曲《如果》；同年12月凭借歌曲《听得见吗》获得第23届韩国金唱片大奖人气奖 。'),(23,'毛不易','1','singerPic|maobuyi.jpg','1994-10-01 18:59:43','中国黑龙 江','原名王维家，1994年10月1日出生于黑龙江省齐齐哈尔市泰来县，中国内地流行乐男歌手，毕业于杭州师范大学护理专业。'),(24,'胡歌','1','singerPic|huge.jpg','1982-09-02 17:52:02','中国上海','中国著名男演员、歌手，有“古装王子”的美称。2005年毕业于上海戏剧学院01级表演系本科，在电视连续剧《仙剑奇侠传》中成功塑造了豪爽深情的“李逍遥”而成名，他还为此剧唱插曲《六月的雨》《逍遥叹》等。胡歌主演过多部广为人知的影视剧，多部电视剧打破电视台收视记录。其人擅长摄影，文采飞扬，志做导演，频唱影视剧歌曲。2013年，主演的话剧《如梦之梦》和《永远的尹雪艳》登上舞台。'),(25,'陈势安','1','singerPic|chengshian.jpg','1984-06-04 17:57:54','马来西亚','陈势安（1984年6月4日－）为马来西亚籍的西马男歌手，出生于槟城州威省大山脚，出道前是个化妆师。2011年发行个人第三张专辑《再爱一遍，天后陈势安》。'),(26,'王菲','0','singerPic|wangfei.jpg','1969-08-08 17:58:31','中国北京','中国著名女歌手、演员。是继邓丽君后大中华地区成就最高、影响力最大的华语女歌手。以其极具辨识度的天籁空灵般嗓音，在华语歌 坛创造了属于她自己的时代。她是首位登上美国《时代周刊》封面并接受CNN专访的华语歌手。她是身价最高，演唱会上座率最高，演唱 会票房累计最高的华语女歌手。王菲北京出生。1987年放弃厦门大学生物系的录取跟随父母移居香港，并拜师戴思聪学习声乐，1989年签约新艺宝唱片公司并发行了第一张个人专辑，从此正式步入乐坛，曾使用艺名王靖雯。'),(27,'Álvaro Soler','1','singerPic|soler.jpg','1991-01-01 23:43:19','西班 牙','全名是Álvaro Tauchert Soler，是一位新晋西班牙歌手，流行音乐作曲家。出生于1991年，西班牙巴塞罗纳。'),(28,'Celine Dion','0','singerPic|Celine Dion.png','1968-03-30 00:00:00','加拿大','1980年，12岁的席琳·迪翁步入歌坛，15岁时推出首支法文单曲，1990年，推出首张英文专辑《UNISON》。1996年为美国亚特 兰大奥运会演唱了主题曲《The Power of The Dream》。1997年为电影《泰坦尼克号》献唱片尾曲《My Heart Will Go On》，并获得第70届奥斯卡最佳电影歌曲奖。'),(29,'胡伟立','1','singerPic|胡伟立.png','1937-01-01 00:00:00','中国江苏','中国音乐家协会会员、中国电影家协会会员、中国电影音乐学会特约理事、香港作曲家作词家协会（CASH）会员、香港弦乐教师协会理事、香港艺术家联盟会员、香港电影戏剧总会会员。主要作品有《神州行组曲》、《北国风云》、《C大调中胡协奏曲》等大型合奏曲。'),(30,'五月天','2','singerPic|五月天.jpg','1997-03-29 00:00:00','中国台湾','五月天（Mayday），中国台湾摇滚乐团，由温尚翊（怪兽）、陈信宏（阿信）、石锦航（石头）、蔡升晏（玛莎）、刘谚明（冠佑）五位成员组成。\n乐团前身为“So Band”乐团，在1997年3月29日更名为“五月天”。'),(31,'Beyond','2','singerPic|Beyond.jpg','1983-01-01 00:00:00','中国香港','中国香港摇滚乐队，由黄家驹、黄贯中、黄家强、叶世荣组成。'),(32,'Ramin Djawadi','1','singerPic|Ramin Djawadi.jpg','1974-06-05 00:00:00','德国','德籍伊朗作曲家，为电影和电视剧担任管弦配乐作曲家，因曾获得格莱美奖提名而逐渐为人所熟知。'),(33,'小林未郁','0','singerPic|小林未郁.jpeg','1978-01-01 00:00:00','日本','日本女钢琴家、歌手。'),(34,'Various Artists','3','singerPic|Various Artists.jpg','2020-04-05 00:00:00','','暂无介绍'),(35,'少女时代','2','singerPic|少女时代.jpg','2007-08-05 00:00:00','韩国','少女时代（Girls\' Generation）是韩国SM娱乐有限公司于2007年推出的女子流行演唱团体，由金泰妍、郑秀妍、李顺圭、黄美英、金 孝渊、权俞利、崔秀英、林允儿和徐珠贤9人组成，现以5人形式进行演艺活动。'),(36,'The Piano Guys','2','singerPic|the piano guys.jpg','2012-07-01 00:00:00','美国','The Piano Guys直译为“钢琴男孩儿”，台湾翻译成“酷音乐团”。apple music在中国区上架后，有译“钢琴达人”。作为Neo-classical目前的代表性乐团之一，初衷是创造出能够激励人们的音乐和视频，想将自己的音乐带给这个世界。The Piano Guys改编的古典音乐融合自然、过渡流畅，MV拍摄优美大气、富于想象力。'),(37,'Peter Broderick','1','singerPic|Peter Broderick.jpeg','1987-01-20 00:00:00','美国','是美国音乐家和作曲家，来自俄勒冈州的卡尔顿。他以自己的名义发布的独奏材料，成为了Efterklang的成员之一， 并与多个乐团合作创作，作为一个自由音乐家演奏。'),(38,'Shayne Ward','1','singerPic|Shayne Ward.jpg','1984-10-16 00:00:00','英国','2005年，肖恩·沃德因获得英国歌唱选秀节目《The X Factor》年度总冠军而成名 [1]  。赛后，签约索尼旗下公司Syco Music ，并发行单曲《That\'s my goal》，以超过31.3万张的销售成绩创下英国唱片单曲首日畅销纪录第三名和英国单日付费下载次数最多的单曲吉尼斯纪录。'),(39,'Yiruma','1','singerPic|Yiruma.jpg','1978-02-15 00:00:00','韩国','李闰珉出生于韩国首尔，在英国长大，曾就学于英国伦敦\'The Purcell School\' 特别音乐学校，后来毕业于 \'King\'s College London\' ，主修作曲。'),(40,'Josh Ritter','1','singerPic|Josh Ritter.jpg','1976-11-21 00:00:00','美国','Josh Ritter (born October 21, 1976) is an American singer-songwriter, guitarist and author who performs and records with The Royal City Band.'),(41,'Tone Damli Aaberge','0','singerPic|Tone Damli Aaberge.jpg','1988-04-12 00:00:00','挪威','Tone Damli Aaberge/Tone Damli，是位来自挪威的年轻女歌手。当她才17岁的时候，曾参加了2005年那届挪威 偶像。可惜她在比赛中获得亚军，屈居于Jorun Stiansen之后。她是2009年欧洲电视网歌唱大赛里的总决赛选手，她演唱了一首\"Butterflies\"，可惜最后也只得到亚军，屈居于Alexander Rybak之后'),(42,'Sanna Nielsen','0','singerPic|Sanna Nielsen.jpg','1984-11-27 00:00:00','瑞典','Sanna Nielsen（仙娜·尼利森）出生于1984年11月27日，瑞典音乐才女，早在她12岁时就发行了其个人的第一张专辑，并且取得了相当不错的成绩，之前她一直是发行瑞典语的专辑和单曲，《Stronger》是她08年的新专，也是她第一张英文专辑，整张专的旋律给人很美很大气的感觉。'),(43,'Jessica','0','singerPic|郑秀妍.jpg','1989-04-18 00:00:00','韩国',' 郑秀妍（Jessica Jung），1989年4月18日出生于美国加利福尼亚州旧金山市，歌手、演员、设计师。2000年，郑秀妍回国探亲时被韩国SM娱乐有限公司发掘，成为其旗下练习生。2007年8月，以演唱团体少女时代成员身份正式出道，是组合里训练时间最长的成员。2009年，首次在音乐剧《金发尤物》中担任主角“艾莉·伍兹”。2012年，首次以演员身份参演《暴力罗曼史》。'),(45,'111','0','singerPic|user.jpg','2022-04-11 00:00:00','222',''),(46,'11111','1','singerPic|user.jpg','2022-12-31 08:00:00','',''),(48,'伍佰','1','singerPic|wubai.jpg','1968-01-14 00:00:00','中国台湾新北 市新店区','伍佰（Wu Bai），本名吴俊霖，1968年1月14日出生于中国台湾新北市新店区，华语流行乐男歌手、词曲作者、音乐人、吉 他手、演员、摄影师'),(49,'蔡徐坤','1','singerPic|caixukun.jpg','1998-08-02','浙江省温州市',' 蔡徐坤（KUN），1998年8月2日出生于浙江省温州市，户籍湖南省吉首市 [114]，中国内地男歌手、演员、原创音乐制作人 [1]、MV导演 [83]。\n2012年8月，蔡徐坤参演的偶像剧《童话二分之一》播出，由此开始步入大众视线。2018年1月，参加竞演类综艺节目《偶像练习生》并以总票数第一正式出道，成为限定男团NINE PERCENT队长 [2]；8月，发行首张EP《1》，获2018亚洲新歌榜年度盛典最受欢迎潜力男歌手奖 [3]；随后，他还发行原创单曲《Wait Wait Wait》，并携手格莱美奖最佳MV获奖导演戴夫·迈尔斯打造歌曲MV。2019年1月，被授予“中牙友好大使暨中牙杰出青年领袖人物”称号；3月，成功开启横跨三个国家、六座城市的海外公演《ONE》 [6-7]；7月，发行首张 数字专辑《YOUNG》 [85]；10月，携手中国儿童少年基金会共同设立“葵计划爱心基金”。'),(50,'何名玉卉','0','2024-09|1725360413891-微信截图_20240903184646.png','2024-09-01','阿巴巴','阿巴巴巴'),(52,'xw','0','singerPic|1725417765023-1238602814.png','2024-09-04',NULL,''),(53,'泰勒·斯威夫特（Taylor Swift）','0','singerPic|1727939494957-R-C.jpg','1989-12-13','美国','泰勒·斯威夫特（Taylor Swift），1989年12月13日出生于美国宾夕法尼亚州，美国女歌手、词曲作者、音乐制作人、演员。\n2006年，发行个人首张音乐专辑《Taylor Swift》 [1]。2008年，凭借音乐专辑《Fearless》获得关注 [2]，该专辑亦获得第52届格莱美奖“年度专辑奖”等多个奖项 [3]，成为史上获奖最多的乡村专辑 [147]。2010年-2012年，发行融合多种风格的音乐专辑 《Speak Now》《Red》 [148] [244]。2014年，转战流行乐并发行音乐专辑《1989》 [4]，该专辑打破12年内美国唱片市场的单周销量最高纪录 [5]，并获得第58届格莱美奖“年度专辑奖” [149]。2017年，发行音乐专辑《reputation》 [7]，并因此成为首位拥有四张首周百万销量专辑的歌手 [156]。2019年，发行音乐专辑《Lover》 [151]，并获得第47届全美音乐奖“年度艺人奖”等六个奖项 [131]、第36届MTV音乐录影带奖“年度录影带奖”等三个奖项 [10]；同年，因版权纠纷决定重录前6张音乐专辑 [147]。2020年，发行音乐专辑《folklore》《evermore》 [14-15]，前者获得第63届格莱美奖“年度专辑奖” [152]。2022年，发行音乐专辑《Midnights》 [95]，并凭借该专辑收获三项吉尼斯世界纪录 [130]。2023年，举行“时代”世界巡回演唱会，带来近50亿美元的经济效应 [154]。'),(54,'宋雨琦','0','singerPic|1727940905091-1mSjwV2MfQYWeNA.heif','1999-09-23','中国北京','宋雨琦（YUQI），1999年9月23日出生于北京市，中国内地女歌手、演员，韩国女子演唱组合(G)I-DLE成员。'),(55,'陶喆','1','singerPic|1727941205069-陶喆.png','1969-07-11','中国香港','陶喆（David Zee Tao），1969年7月11日出生于香港，祖籍江苏省南京市 [144]，华语流行乐男歌手、音乐制作人、词曲作者 [162] ，毕业于加利福尼亚大学洛杉矶分校。'),(56,'徐天宇','1','singerPic|1728899708202-OIP-C.jpg','2024-10-24',NULL,NULL);
