DROP TABLE IF EXISTS `music_song`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `music_song` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '歌曲的唯一标识符',
  `singer_id` int NOT NULL COMMENT '演唱该歌曲的歌手的唯一标识符',
  `name` varchar(45) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '歌曲的名字',
  `introduction` text CHARACTER SET utf8mb3 COLLATE utf8_general_ci COMMENT '歌曲的简介或介绍',
  `create_time` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci DEFAULT NULL COMMENT '歌曲的发行时间',
  `update_time` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci NOT NULL COMMENT '歌曲信息的最后更新时间',
  `pic` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci DEFAULT NULL COMMENT '歌曲封面图片的路径',
  `lyric` text CHARACTER SET utf8mb3 COLLATE utf8_general_ci COMMENT '歌曲的歌词',
  `url` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8_general_ci DEFAULT NULL COMMENT '歌曲文件的路径',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=361 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;
/*!40101 SET character_set_client = @saved_cs_client */;

