\n[02:52.990]我不当梦  的幸存者\n[02:55.330]我清醒  随兴唱歌  放松快乐\n[02:58.580]一起进来我  的圣所\n[03:04.340]7千3百多天  我们一起数一起  纪念\n[03:09.620]开心的画面  至今仍鲜艳\n[03:15.129]有你们在身边  一切暖在我的心  里面 (天天天天在心里面)\n[03:20.840]第二天堂 (渐渐渐渐 梦想不远)  就在眼前 (共渡7千多天)\n[03:26.310]我的世界  就是听觉\n[03:28.639]除了音乐  无从分类  我的一切\n[03:32.030]有一种活着  的感觉\n[03:38.666] 制作人 PRODUCER:林俊杰 JJ LIN\n[03:38.943] 配唱制作 VOCAL PRODUCTION:林俊杰 JJ LIN \n[03:39.220] 制作协力 PRODUCTION ASSISTANCE:黄冠龙 ALEX.D / 周信廷 SHiN CHOU / 蔡宥绮 Patti Tsai / 蔡凯升 Kai Tsai\n[03:39.497]  \n[03:39.774] 编曲 MUSIC ARRANGEMENT:Tat Tong / 林俊杰 JJ LIN\n[03:40.051] 吉他 GUITAR:黄冠龙 ALEX.D\n[03:40.328] 和声编写 BACKGROUND VOCAL ARRANGEMENT:林俊杰 JJ LIN\n[03:40.605] 和声 BACKGROUND VOCALS:林俊杰 JJ LIN \n[03:40.882]  \n[03:41.159] 录音室 RECORDING STUDIOS: THE JFJ BLUE ROOM (Singapore)\n[03:41.436] 录音师 RECORDING ENGINEERS:林俊杰 JJ LIN / 黄冠龙 ALEX.D\n[03:41.713]  \n[03:41.990] 混音室 MIXING STUDIO:mixHaus (Encino, CA) \n[03:42.267] 混音师 MIXING ENGINEER:Richard Furch \n[03:42.544]  \n[03:42.821] 后期母带处理制作人 MASTERING PRODUCER：林俊杰 JJ LIN  \n[03:43.098] 后期母带处理录音室 MASTERING STUDIOS：Bernie Grundman Mastering, LA  \n[03:43.375] 后期母带处理录音师 MASTERING ENGINEERS：Mike Bozzi','http://127.0.0.1:1234/?explorer/share/file&hash=3d8bN4STQEuOJMu1UaCl34a1mQ34hv_yJx9ZWYc8d1yD2-XxGwHteQiByviquouMVIY');
